import React from 'react';
import './Styles.css'

function Menu() {
  return (
    <div className="menu">
      <div className="logo">
        <img src="caminho-para-o-seu-logo.png" alt="Logo do Site" />
      </div>
      <div className="search">
        <input type="text" placeholder="Pesquisar" />
        <button>Pesquisar</button>
      </div>
      <div className="login">
        <button>Login</button>
      </div>
    </div>
  );
}

export default Menu;
